import React from 'react';
import styled from 'styled-components';

import NavItem from '../../Navigation/NavItem.js'

const Nav = styled.nav`
  display: flex;
  margin-top: null;
`
const Ul = styled.ul`
  display: flex;
  align-items: center;
  height: 100%;
`

const MenuNavItems = ({ clicked, emailVerified }) => {
    let links = (
        <Ul>
            <NavItem clicked = {clicked}> Food </NavItem>
            <NavItem clicked = {clicked}> Drinks </NavItem>

        </Ul>
    )

    return <Nav>{ links }</Nav>
}


export default MenuNavItems
